// Step 2: Convert each raw SVG into a component with props support
const svgToComponent = (svg: React.ReactElement): React.FC<IconProps> => {
  return ({ size = 16, ...props }) =>
    React.cloneElement(svg, {
      width: size,
      height: size,
      ...props,
    });
};

// Step 3: Export all icons
export const Icons: Record<string, React.FC<IconProps>> = rawSVGElements.reduce(
  (acc, svg) => {
    const name = svg.key as string;
    acc[name] = iconWrapper(svgToComponent(svg));
    return acc;
  },
  {} as Record<string, React.FC<IconProps>>
);
